import {Box ,styled } from '@mui/material'; 

const Login = () => {
    const Component = styled(Box)`
    width : 400px;
    margin auto;
    box-shadow : 5px 2px 5px 2px rgb(0 0 0 0.76);
    `
    return (
        <component>
            <p>
                Hello World
            </p>
        </component>
    );
}

export default Login;
